const myImage = new Image();
myImage.src=`data:image/jpeg;base64,`  
const canvas = document.querySelector("#canvas1");
const ctx = canvas.getContext("2d");

myImage.addEventListener("load", function() { //Using base 64 prevents issues due to default browser settings with images
    
    canvas.width = 300;
    canvas.height = 316;
    
    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);  //Create Image
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height); // Contains rgba values for pixels
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    
    let particlesArray = [];
    const numberOfParticles = 1000;

    let mappedImage = []; // Containing Brightness of every pixel
    for(let y = 0; y < canvas.height; y++) {
        let row = [];
        for(let x = 0; x < canvas.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellBrightness = brightness, 
            ];
            row.push(cell)
        }
        mappedImage.push(row);
    }

    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red*red) * 0.299 + 
            (green*green) * 0.587 + 
            (blue*blue) * 0.114 // Special formula for brightness due to human perception depending on color
        )/100;
    }

    class Particle {
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 0.5;
            this.fontSize = 12;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }
        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = parseInt(mappedImage[this.position1][this.position2][0]); // Vary speed of particle based on brightness of pixel
            let movement = (2.5 - this.speed) + this.velocity 

            this.y += movement;
            if(this.y >= canvas.height) { //if hits bottom respawn
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }

        draw() {
            ctx.beginPath();
            ctx.fillStyle = "#0cf25d";
            ctx.font = `${this.fontSize}px Ubuntu Mono`
            ctx.fillText(`${Math.round(Math.random())}`, this.x, this.y);
            ctx.fill();
        }
    }
    function init() {
        for(let i = 0; i < numberOfParticles; i++) { //Generate tons of random particles
            particlesArray.push(new Particle);
        }

    }

    function animate() {
        ctx.globalAlpha = 0.05; // opacity => makes it leave  a trace
        ctx.fillStyle = "#000";
        ctx.fillRect(0, 0, canvas.width, canvas.height) // turn canvas black
        ctx.globalAlpha = 0.2;

        for(let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update(); //Update position for every particle
            ctx.globalAlpha = particlesArray[i].speed / 2;
            particlesArray[i].draw();
        }
        if(isMouseHovering && Math.abs(totalOffsetX-cursorXPos) > 1) { //If the rain is not at same point as curosr
            totalOffsetX += rainSpeed;
            console.log(totalOffsetX, cursorXPos);
            if(totalOffsetX > -100) { 
                ctx.translate(rainSpeed, 0);  //move rain by speed
            } else {
                totalOffsetX -= rainSpeed;
            }
        }

        requestAnimationFrame(animate);

    }
    init();    
    animate();
})

let isMouseHovering = false;
let rainSpeed = 0;
let totalOffsetX = 0;
let cursorXPos = 0;

canvas.addEventListener("mousemove", function(e) {
    cursorXPos = e.offsetX-200; //Cursor position
    rainSpeed = (e.offsetX-200)/(Math.random()*50 +25); //How fast to move rain
})

canvas.addEventListener("mouseover", function(e) {
    isMouseHovering = true;
})

canvas.addEventListener("mouseout", function(e) {
    isMouseHovering = false;
})